import style from "./Output.module.css";

const Output = ({ setPage, menus ,setMenus }) => {
  return (
    <div className={style.output}>
      <div className={style.title}>Output</div>
      <div className={style.table}>
        <table>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Price</th>
          </tr>
          {
            menus.map((menu, i) => {
            return (
              <tr key={i}>
                <td>{menu.id}</td>
                <td>{menu.name}</td>
                <td>{menu.price}</td>
              </tr>
            )
          })}
          <tr>
            <td colSpan={2}><input type="text" placeholder=""/></td>
            <td colSpan={1}></td>
          </tr>
        </table>
      </div>
      <div className={style.index}>
        <button
          onClick={() => {
            setPage("/");
          }}
        >
          첫 페이지로
        </button>
      </div>
    </div>
  );
};

export default Output;
